declare const SQL_QUERY = "\nUPDATE OR IGNORE Election SET\n  \"id\" = IFNULL(\"id\", @id), \"electionDate\" = IFNULL(\"electionDate\", @electionDate), \"name\" = IFNULL(\"name\", @name), \"type\" = IFNULL(\"type\", @type), \"turf\" = IFNULL(\"turf\", @turf)\nWHERE\n  \"id\" = @id\n";
export default SQL_QUERY;
